(1, 'Home', '<header class=\"section-header\">\n<h4>What Is</h4>\n\n<h1 class=\"border-heading\">LIMINAL?</h1>\n</header>\n\n<p class=\"content\">We are a group of seasoned practitioners curating content and experiences for your church or organization that will transform and grow your community and you.</p>\n\n<div class=\"row\">\n<div class=\"col-md-4 col-lg-4 wow bounceInUp\" data-wow-duration=\"1.4s\">\n<div class=\"box\">\n<div class=\"icon\"><img src=\"http://localhost/liminal/assets/frontend/img/icon2.png\" /></div>\n\n<h4 class=\"title\"><a href=\"\">When you feel stuck.</a></h4>\n</div>\n</div>\n\n<div class=\"col-md-4 col-lg-4 wow bounceInUp\" data-wow-duration=\"1.4s\">\n<div class=\"box\">\n<div class=\"icon\"><img src=\"http://localhost/liminal/assets/frontend/img/icon1.png\" /></div>\n\n<h4 class=\"title\"><a href=\"\">We help you transform</a></h4>\n</div>\n</div>\n\n<div class=\"col-md-4 col-lg-4 wow bounceInUp\" data-wow-delay=\"0.1s\" data-wow-duration=\"1.4s\">\n<div class=\"box\">\n<div class=\"icon\"><img src=\"http://localhost/liminal/assets/frontend/img/icon3.png\" /></div>\n\n<h4 class=\"title\"><a href=\"\">Know Freedom, and Live.</a></h4>\n</div>\n</div>\n</div>\n', 'Testing sDescription test', '1575443862_f987cf945564c0f66f40.png', '2020-05-12 12:50:11', '1'),
(2, 'About', '<div style=\"background:#eeeeee; border:1px solid #cccccc; padding:5px 10px\"><strong>organization</strong> that will transform and grow your community and you. <em>We</em> are a group of seasoned practitioners curating content and experiences for your church or</div>\r\n', 'About Us SDescription', '1576146337_950a867e089a5d493dfe.png', '2019-12-30 21:39:21', '1'),
(3, 'Event Agreement', '<p>By signing below, I acknowledge that I have read, understand, and agree to the following terms and conditions that will be in effect before, during, and after my involvement with Liminal&#39;s Program and its program guidelines.</p>\r\n\r\n<p>I agree to accept the concept of a chemical-free existence during the program. This means abstinence from all mind and mood affecting drugs and chemicals (excluding those prescribed by a physician), including alcohol, nicotine, and marijuana. I agree to remain abstinent from mind and mood affecting drugs and chemicals at least 15 days before the start of my program. I understand that any use of these chemicals may result in my discharge from the program.</p>\r\n\r\n<p>Since this is a nicotine-free program, participants who smoke or use tobacco in other forms will address their nicotine use as a part of this program. I understand I will be required to abstain upon my arrival to the program and throughout my stay.</p>\r\n\r\n<p>I understand this is a prepaid program, and I agree to meet all financial requirements at the time of registration of the program. In addition to Liminal&#39;s pre-program registration and cancellation fee policies, I understand the program is on a &quot;fee for service&quot; basis. This means that since Liminal has made prior arrangements and incurred costs to provide said services for me, I will not be entitled to or receive a refund of any fees I have paid for any reason, even if I do not participate in or receive all of the services scheduled for me. Whether I complete the program as scheduled, or I am discharged from, or I discharge myself from the program before its completion, I understand I will not be entitled to or receive a refund of any portion of the prepaid program costs, including transportation to or from the program site.</p>\r\n\r\n<p>I understand that seeking and receiving insurance reimbursement is solely my responsibility and not the responsibility of Liminal. Liminal does not provide DSM psychological diagnosis or CPT codes to insurance companies.</p>\r\n\r\n<p>I understand and accept that Liminal makes no explicit or implied guarantees or warranties as to my successful completion of the program, the quality of my experience during the program, or my post-program experiences directly or indirectly resulting from my participation in the program.</p>\r\n\r\n<p>I understand my participation in this program is voluntary, and the program may be physically and emotionally intense. I agree to accept such risks and I assume responsibility for such stress/distress and/or other effects of my participation. I hereby release, discharge and hold harmless Liminal Partners, LLC and all of its staff of and from any and all claims, causes of action, demands, or judgments arising out of or in any way connected with my participation in the Liminal&rsquo;s program and all related activities, including those arising out of the negligence of any of the aforementioned parties. I understand that participation in any of these activities contains certain risks of physical injury or death. I agree to assume fully the risk of injury or death arising from any such activity.</p>\r\n\r\n<p>I understand I have the responsibility of assuming a leadership role regarding my own care and safety in this workshop.</p>\r\n\r\n<p>As a condition of acceptance in the program, I agree to provide my complete medical history as provided for by the form entitled Health Questionnaire and incorporated herein as if fully set forth in this contract. Please be aware that when you share information with Liminal via email, Liminal cannot guarantee the confidentiality of that information due to the nature of the Internet. Receiving an email from you will be understood as permission to respond to you by email. Giving us your email implies consent to contact you via email regarding upcoming programs or administrative concerns. This implied permission may be revoked by you at any time by contacting us by phone, email, or in writing. No personal health information will be transmitted unless it is in response to your email to us. Additionally, the use of cell phones is not a guarantee of privacy in communicating. When you contact Liminal staff, you may or may not be calling a cell phone.</p>\r\n\r\n<p>I understand and agree that it may be necessary to make my medical history available to a hospital, physician, or other health care provider in the event that I am in need of medical treatment; therefore, I authorize Liminal to release my medical history for that purpose. In the event of any medical emergency, I hereby authorize and give my full consent to Liminal personnel to take all appropriate measures to provide me with medical assistance including, if appropriate, permission to transfer me to another facility.</p>\r\n\r\n<p>I understand that my participation in the program will involve interaction with other program participants who may have a contagious/infectious disease which may include but are not limited to known and unknown flu viruses, Hepatitis, HIV, bacterial infections, etc. and that Liminal takes universal precautions for the safety of all participants. I agree to assume the risk of such exposure and I agree to hold Liminal Partners harmless and free from any and all claims, including reasonable attorney fees.</p>\r\n\r\n<p>I understand that some Liminal events are hosted in remote locations and that wild or stray animals may come onto the property and that Liminal is not liable for any injury.</p>\r\n\r\n<p>I understand that firearms, ammunition, or weapons of any kind are not allowed on property at any time. A gun permit does not authorize a participant to bring firearms onto the property, or any buildings, that the Liminal event is hosted at under any circumstances.</p>\r\n\r\n<p>I agree not to engage in any activity that may cause damage to the property at which the Liminal event is being hosted. If damage does occur, I agree to pay the full amount of damages. I also agree not to remove any items (including but not limited to pillows, blankets, etc.) from the rooms located at the property and understand that if objects are removed, I am financially responsible for replacing missing objects.</p>\r\n\r\n<p>I have fully and truthfully disclosed all information regarding my medical and physical history, including and medical conditions and medications which I am currently taking, whether prescribed or not.</p>\r\n\r\n<p>I have fully and truthfully completed the program assessment and all other documents provided by program staff.</p>\r\n\r\n<p>The program will take place in a retreat setting. As such, I understand that the program participants, including myself, are not in a licensed health care setting or facility and will not receive medical supervision or monitoring. The program experience is designed to promote wellness and improve the ability of participants to function in a healthier manner emotionally, spiritually, and psychologically. The program experience is not a substitute for inpatient nor extended outpatient treatment.</p>\r\n\r\n<p>I will not reveal nor discuss outside of any group process anything that happens, is said, or done within any group process. I will not reveal the identities of any participants, family members, or program participants who are or may have been at the Liminal event. I understand that violation of this confidentiality pledge will be grounds for immediate dismissal from any/all Liminal programs and may subject me to civil and/or criminal penalties.</p>\r\n\r\n<p>I understand that Liminal operates under strict privacy policies but cannot guarantee that all group members will keep strict confidentiality. I also understand that Liminal cannot completely control the nature of information participants may reveal about themselves in the group process.</p>\r\n\r\n<p>I authorize Liminal staff to contact me via electronic mail. I further understand correspondence may be confidential in nature and electronic mail is not a secure form of communication.</p>\r\n\r\n<p>I have reviewed this agreement and all program documentation I&rsquo;ve been provided carefully. I have been informed, to my satisfaction, as to what may occur during the program.</p>\r\n\r\n<p>I state that I have carefully read the foregoing terms and conditions, know the contents thereof, and I sign the same as my own free act. I hereby agree to accept and abide by the policies, guidelines, conditions, and procedures as set forth in the agreement and the Program Guidelines.</p>\r\n', 'Agreements', '', '2020-01-10 11:52:10', '1'),
(4, 'Financial Agreement', '<p> This is a prepaid program. The full program cost must be paid before you will be admitted. We accept credit card payment prior to onsite registration and a check at registration. Your program fee covers lodging, program fees, on-campus meals, and all activities.</p>\r\n					   <p>You can pay online at https://liminalwork.com/shop. Find the event you are signing up for there, add it to your cart, checkout and make payment.</p>\r\n<p>If you made a deposit for the event and need to pay your balance, find the invoice for balance payment email you received when you made your payment initially.  At the bottom of the email, you will find a link to pay for the balance.</p>\r\n<p>All balances must be paid prior to the weekend in order for you to be admitted.</p>\r\n\r\n<h5>CANCELLATIONS</h5>\r\n<p>For all Liminal programs if a cancellation occurs 14 or more days prior to a programs start date, the full amount, less $100 processing fee per person, will be refunded. If a cancellation occurs less than 14 days before the programs start date, the entire amount will be non-refundable. No refunds are given for any program if a participant does not attend or show up, leaves the program early, or does not complete the program.</p>\r\n\r\n<h5>TRANSFERS</h5>\r\n<p>For all Liminal programs, participants must submit a request to be transferred in writing 14 days prior to the program start date. Transferring to another program will incur a $100 per person processing fee. Participants will not be permitted to transfer unless the request has been received and approved.</p>\r\n<p>I understand this is a prepaid program, and I agree to meet all financial requirements at time of registration to the program. I understand Liminal\'s pre-program registration and cancellation fee policies. I also understand that whether I complete the program as scheduled, or I am discharged from, or I discharge myself from, the program before its completion, I will not be entitled to, or receive, a refund of any portion of the prepaid program costs, including transportation to or from the program site.</p>', 'Financial', '', '2020-01-10 11:52:52', '1'),
(5, 'Copyright Agreement', '<p>This Agreement is between Liminal Partners, LLC., Shadow Work Licensing LLC., Shadow Work Seminars Inc., The Crucible Project, Inc, and The ManKind Project Inc., (collectively known herein as &ldquo;the Licensors&rdquo;), and me.</p>\r\n\r\n<p>I agree that the Licensors are the owners of various Copyrighted Materials, Intellectual Property, Trade Secrets, Know How and Trademarks. For purposes of this Agreement &ldquo;Protected Materials&rdquo; shall include any Copyrighted Materials, Intellectual Property, Trade Secrets, Know How or Trademarks provided to me in any form or media by the Licensors, or taught to me by the Licensors or their training agents. All Protected Materials and any additions, derivations or other modifications are the sole property of the Licensors.</p>\r\n\r\n<p>I understand and agree that any particular part of the Protected Materials remains the sole property of the Licensor which created that particular part of the Protected Materials, and that by staffing or otherwise attending an Event sponsored by one of the Licensors, I acquire no rights to the Protected Materials, including the right to create any additions, modifications, derivations or any other materials directly or indirectly related or based on the Protected Materials, without the written permission of the Licensor which created that particular part of the Protected Materials. I agree not to remove any proprietary copyright and trademark notices from the Protected Materials.</p>\r\n\r\n<p>The Licensors herby warrant that while staffing an Event sponsored by one of the Licensors, I have the right to utilize the Protected Materials belonging to that Licensor for the purpose of staffing that sponsored Event.</p>\r\n\r\n<p>I agree not to use any of the Protected Materials: (i) to create a course, products, services or other material that would be in competition with the Licensors or any products and/or services belonging to the Licensors without written permission from the Licensors, (ii) to train any others in the Licensors&rsquo; Protected Materials or methods without written permission from the Licensors.</p>\r\n\r\n<p>I agree that the Licensors assume no liability to me with respect to the Protected Materials.</p>\r\n\r\n<p>I agree to indemnify and hold all the Licensors harmless from and against any and all losses, liabilities, claims, damages and expenses of any kind that result from any breach of this Agreement on my part.</p>\r\n\r\n<p>In the event a dispute arises regarding this Agreement, I agree to work with the Licensor which sponsored the Event I staffed to resolve the dispute first by using a mutually-agreed communications format, and thereafter, if the same fails to be resolved, by using mediation, before taking legal action. If the communications format and mediation fail to resolve the dispute, any party to this Agreement may terminate this Agreement upon thirty (30) days written notice. Upon any termination, I agree that my rights and privileges granted in this Agreement shall be terminated, including any and all uses of the Protected Materials.</p>\r\n\r\n<p>This Agreement is governed by Colorado law, regardless of the place of execution or the place of performance. In the event of legal action, I agree that the losing party shall pay the prevailing party for all reasonable attorney fees and expenses.</p>\r\n\r\n<p>If any provision of this Agreement is held invalid or unenforceable by a court of competent jurisdiction, it is the intent of the parties that all of the remaining provisions of this Agreement be construed to remain fully valid, enforceable, and binding on the parties.</p>\r\n\r\n<p>I have read, understand and I agree to the foregoing.</p>\r\n', 'Copyright', '', '2020-01-10 11:53:31', '1'),
(6, 'Training', '<p>Liminal Training to enable those men and women who are either professionally trained in other therapy-based modalities, or men and women who have gone through Liminal (or similar) experiences and would like to be professionally trained by Shadow-Work certified trainers.&nbsp; Being trained by our certified training team will put you on a new journey where you can positively impact other men and women by coming alongside them in their journey in safe way to help them know freedom and live who the Creator meant them to be.</p>\r\n\r\n<p>This is a great way to grow your depth in your own work and put yourself on a path to earn additional money at the same time.</p>\r\n', 'Training Info here', '', '2020-02-17 15:00:06', '1');
